Templates.helpDescription:
Displays the given title in the shell header. This method should not be called - and will be without effect - if the app calling the method is not currently displayed in the Fiori launchpad.

The sTitle will be concatenated with the window title extension and displayed as browser tab title. If oAdditionalInformation is set, the browser tab title will be constructed from the oAdditionalInformation plus window title extension. sTitle is still used in the shell header.

Examples: <pre>
  // Window Title Extension is: "Fiori Launchpad"

  setTitle("My App Title");
  // Shell Header title: "My App Title"
  // Browser Window Title: "My App Title - Fiori Launchpad"
</pre>

<pre>
  // Window Title Extension is: "Fiori Launchpad"

  setTitle("My App Title", {
    headerText: "My Header Text",
    additionalContext: "My Additional Context",
    searchTerm: "My Search Term",
    searchScope: "My Search Scope"
  });
  // Search Term has precedence over headerText and additionalContext.
  // Shell Header title: "My App Title"
  // Browser Window Title: "My Search Term in My Search Scope - Search - Fiori Launchpad"
</pre>

<pre>
  // Window Title Extension is: "Fiori Launchpad"

  setTitle("My App Title", {
    headerText: "My Header Text",
    additionalContext: "My Additional Context"
  });
  // Shell Header title: "My App Title"
  // Browser Window Title: "My Header Text - My Additional Context - Fiori Launchpad"
</pre>

