Templates.helpDescription:
Creates and displays a sub header control in Fiori launchpad, in the given launchpad states.<br> The new control is displayed in FLP UI according to the given display parameters.<br> If a sub header already exists, the new created one will replace the existing one.<br><br> <b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2"),
    oAddSubHeaderProperties = {
        controlType : "sap.m.Bar",
        oControlProperties : {
            id: "testBar",
            contentLeft: [new sap.m.Button({
                text: "Test SubHeader Button",
                press: function () {
                    sap.m.MessageToast.show("Pressed");
                }
            })
        },
        bIsVisible: true,
        bCurrentState: true
    };

oRenderer.addShellSubHeader(oAddSubHeaderProperties);
</pre>

