Templates.helpDescription:
Creates an Action Button in Fiori launchpad, in the given launchpad states. </br> The button will be displayed in the user actions menu, that is opened from the user button in the shell header.</br> <b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2"),
    oAddActionButtonProperties = {
        controlType : "sap.m.Button",
        oControlProperties : {
            id: "exampleButton",
            text: "Example Button",
            icon: "sap-icon://refresh",
            press: function () {
                alert("Example Button was pressed!");
            }
        },
        bIsVisible: true,
        bCurrentState: true
    };
oRenderer.addUserAction(oAddActionButtonProperties);
</pre>

Adds an entry to the User Preferences dialog box including the UI control that appears when the user clicks the new entry, and handling of User Preferences actions such as SAVE and CANCEL.

<b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2");
var oEntry = {
  title: "title",
  value: function() {
      return jQuery.Deferred().resolve("entryTitleToBeDisplayed");
  },
  content: function() {
      return jQuery.Deferred().resolve(new sap.m.Button("userPrefEntryButton", {text: "Button"}));
  },
  onSave: function() {
      return jQuery.Deferred().resolve();
  }
};
oRenderer.addUserPreferencesEntry(oEntry);
</pre>

