Templates.helpDescription:
Creates and displays an SAPUI5 control as the footer of the Fiori launchpad shell.<br> The footer will be displayed in all states. <br> Previously created footer will be removed. <br>

<b>For example, using the sap.m.Bar control:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2"),
  oFooterControlProperties = {
    controlType : "sap.m.Bar",
    oControlProperties : {
      id: "testBar",
      contentLeft: [new sap.m.Button({
        text: "Test Footer Button",
        press: function () {
          sap.m.MessageToast.show("Pressed");
        }
      })]
    }
  };
oRenderer.setShellFooter(oFooterControlProperties);
</pre>
